import React, { Component } from "react";
import TodoMainTitle from "../textComponents/TodoMainTitle";
import LabelIncomplete from "../textComponents/LabelIncomplete";
import LabelFinished from "../textComponents/LabelFinished";
import AddTaskButton from "../buttonComponents/AddTaskButton";
import TaskDescription from "../textComponents/TaskDescription";

const style = {
  container: {
    width: "50%",
    height: "70vh",
    backgroundColor: "#e6e6e6",
    borderRadius: 10,
    display: 'flex',
    alignItems: 'center'
  },
  center: {
    display: "flex",
    justifyContent: "center"
  }
};

export class TodoContainer extends Component {
  render() {
    return (
      <div style={style.container}>
        <div style={style.center}>
          <TodoMainTitle />
        </div>
        <div>
          <TaskDescription text={'Shoppen'} timestamp={'04/08 at 22:45'}/>
        </div>
      </div>
    );
  }
}

export default TodoContainer;
